import React from "react";
import {firebase} from "../../base";
import Card from "../../components/shared/Card/Card";
import Button from "../../components/shared/Button/Button";
import style from "./Room.module.css";
import axios from "axios";

const Rooms = ({history}) => {


    function updatePhoneNumber(Finalphonenumber){
        axios.post(`http://localhost:4000/room`, { phoneNumber:Finalphonenumber })
        .then(res => {
          console.log(res);
          console.log(res.data);
          console.log(res.status);
        })
    }

    updatePhoneNumber(window.phoneNumber);

    var user = firebase.auth().currentUser;
    console.log(user);
    const signOut=()=>{
        firebase.auth().signOut();
        history.push('/home');
    }

    return (
        <div className={style.center}>
            <Card title={`Okay ${user.displayName}`} icon="monkey-emoji">
                Room Section
            <Button text="Sign Out" onNext={signOut}>Sign out</Button>
            </Card>    
        </div>
    )
}

export default Rooms
